package com.wml.springboot.auth.entity;import java.io.Serializable;public class StaffExtendProperty implements Serializable {	private static final long serialVersionUID = -2589343753540793700L;	private Long staffId;	private String property;	private String value;	public Long getStaffId() {		return this.staffId;	}	public void setStaffId(Long staffId) {		this.staffId = staffId;	}	public String getProperty() {		return this.property;	}	public void setProperty(String property) {		this.property = property;	}	public String getValue() {		return this.value;	}	public void setValue(String value) {		this.value = value;	}}